svg.script:


var svg = document.getElementById('svg4814');

function fetchData() {
  var req = new XMLHttpRequest();
  req.addEventListener("load", ajaxSucess);
  req.open("GET", "./data.json");
  req.send();
};

function ajaxSucess() {
  console.log(this.responseText);
  var data = JSON.parse(this.responseText);

  // Consumer output
  displayTxt(data.effekt_ud, svg, 490, 260, 'effect1', 'end');
  displayTxt('kW', svg, 490, 260, 'title1a', 'start');
  displayTxt('Til bygd', svg, 450, 470, 'title1b', 'middle');

  // Generator 1
  displayTxt(data.enheder[0].navn, svg, 260, 620, 'title2', 'end');
  displayTxt(data.enheder[0].effekt + 'kW', svg, 260, 580, 'effect2', 'end');

  // Generator 2
  displayTxt(data.enheder[1].navn, svg, 220, 980, 'title2', 'end');
  displayTxt(data.enheder[1].effekt + 'kW', svg, 220, 1040, 'effect2', 'end');

  // Wind
  displayTxt(data.enheder[2].navn, svg, 670, 640, 'title2', 'start');
  displayTxt(data.enheder[2].effekt + 'kW', svg, 670, 600, 'effect2', 'start');
  displayTxt(data.enheder[2].beskrivelse, svg, 670, 745, 'title3', 'start');
  displayTxt(data.enheder[2].vindhastighed + ' m/s vind', svg, 670, 765, 'title3', 'start');
  displayTxt(data.enheder[3].disel_sparet + ' liter diesel sparet', svg, 670, 785, 'title3', 'start');

  // Solar
  displayTxt(data.enheder[3].navn, svg, 660, 1030, 'title2', 'start');
  displayTxt(data.enheder[3].effekt + 'kW', svg, 660, 1090, 'effect2', 'start');
  displayTxt(data.enheder[3].beskrivelse, svg, 660, 1120, 'title3', 'start');
  displayTxt(data.enheder[3].fladeeffekt + ' W/m2', svg, 660, 1140, 'title3', 'start');
  displayTxt(data.enheder[3].disel_sparet + ' liter diesel sparet', svg, 660, 1160, 'title3', 'start');

  // Battery Banks
  displayTxt(data.enheder[4].navn, svg, 450, 930, 'title2', 'middle');
  displayTxt(data.enheder[4].effekt + 'kW', svg, 450, 1100, 'effect2', 'middle');
  displayTxt(data.enheder[4].kapacitet + '% kapacitet', svg, 450, 1130, 'title3', 'middle');
  displayBatteryStatus(data.enheder[4].kapacitet);

};

function displayTxt(str, parent, posx, posy, style, anchor) {
  var txt_el = document.createElementNS('http://www.w3.org/2000/svg', 'text');
  var txt = document.createTextNode(str);
  txt_el.setAttributeNS(null, 'x', posx);
  txt_el.setAttributeNS(null, 'y', posy);
  txt_el.setAttributeNS(null, 'class', style);
  txt_el.setAttributeNS(null, 'text-anchor', anchor);
  txt_el.appendChild(txt);
  parent.appendChild(txt_el);
};

function displayBatteryStatus(capacity) {
  var rect_el = document.createElementNS('http://www.w3.org/2000/svg', 'rect');
  var ratio = 140 * capacity / 100;
  rect_el.setAttributeNS(null, 'x', 380);
  rect_el.setAttributeNS(null, 'y', 1140);
  rect_el.setAttributeNS(null, 'width', ratio);
  rect_el.setAttributeNS(null, 'height', 20);
  rect_el.setAttributeNS(null, 'class', 'battery-charge');
  svg.appendChild(rect_el);
};

fetchData();
